import React from 'react';
import Button from '../Button';
import '../../App.css';

export default function Home() {
  return (
    <>
      <h1 className='home'>EPIC</h1>
      <div className="commencer">
        <h1>Apprendre en <br></br>s'amusant</h1><br></br>
        <Button text="Commencer" />
        </div>
    </>
  );
}
